import { Box } from '@material-ui/core';
import React from 'react';
import { CommTaskBubble } from '../Bubble/CommTaskBubble';
import { PickCommunicationTask } from '../RenderTaskList';

interface InputProps {
  date: number;
  commData: PickCommunicationTask[];
}

export function CommTaskList({ date, commData }: InputProps) {
  return (
    <Box padding={'0px 50px'} width={'30%'}>
      {CommTaskBubble({
        date,
        commData
      })}
    </Box>
  );
}
